export const placeReducer = (state, action) => {
    switch (action.type) {
        case 'SHOW_PLACES':
            console.log(action.place.columnsCount);
            console.log(state);
            return {
                ...state,
                number: action.place.columnsCount,
            }
        default:
            return state;
    }
}
